import React from "react";
import Header from "../components/Layout/Header";

const UserInbox = () => {
  return (
    <div className="w-full">
      <Header />
      <h1 className="text-center text-[30px] py-3 font-Poppins">
        All Messages
      </h1>
    </div>
  );
};

export default UserInbox;
